import React from 'react';
import Tilt from 'react-parallax-tilt';
import brain100 from './brain100.png'
import './Logo.css';

const Logo = () => {
    return (
        <div className='ma4 mt0'>
            <Tilt className='Tilt br2 shadow-2'>
                <div style={{ height: '100px'}}>
                    <h1><img src={brain100} />'</h1>
                </div>
            </Tilt>
        </div>
    );
};

export default Logo;
